import React, { Component } from 'react';


class WindCard extends Component {

    constructor(props) {
        super(props);
    }
    
    render() {
        return (
            <div className="colour-card blue wind-card">
                <div className="form-card-body">
                    <div className="form-card-body-left">
                        <h3>{props.StationName}</h3>
                        <span>{props.StationLocation}, {props.StationDistance}KM</span>
                    </div>
                    <div className="form-card-body-right">
                    <span style="font-weight: 400">{props.CurrentSpeed} <span style="font-weight: 100">{props.Direction}</span></span>
                        <span style="font-weight: 300">KNOTS</span>
                    </div>
                </div>
            </div>
        )
    }   
}
